import { Component } from 'react';


class Subject extends Component {
    render() {
        console.log("Subject render()");
        return (
            <header>
                <h1><a href="/" onClick={(e) => {
                    e.preventDefault();
                    this.props.onChangePage();
                }}>{this.props.title}</a>
                </h1>
                <p>{this.props.sub}</p>
            </header>
        );
    }
}

export default Subject;
